pragma solidity ^0.5.0;

contract rideshare {
    string public name;
    uint public rideCount = 0;
    mapping(uint => ride) public riders;

    struct ride {
        uint id;
        string route;
        uint fare;
        address payable owner;
        bool rideCompleted;
    }

    event rideAdded(
        uint id,
        string route,
        uint fare,
        address payable owner,
        bool rideCompleted
    );

    event rideCompleted(
        uint id,
        string route,
        uint fare,
        address payable owner,
        bool rideCompleted
    );

    constructor() public {
        name = "rideshare";
    }

    function createRide(string memory _name, uint _price) public {
        require(bytes(_name).length > 0);

        require(_price > 0);

        rideCount ++;

        riders[rideCount] = ride(rideCount, _name, _price, msg.sender, false);

        emit rideAdded(rideCount, _name, _price, msg.sender, false);
    }

    function completeRide(uint _id) public payable {
        // Fetch the product
        ride memory _ride = riders[_id];
        // Fetch the owner
        address payable _rider = _ride.owner;
        // Make sure the product has a valid id
        require(_ride.id > 0 && _ride.id <= rideCount);
        // Require that there is enough Ether in the transaction
        require(msg.value >= _ride.fare);
        // Require that the product has not been rideCompleted already
        require(!_ride.rideCompleted);
        // Require that the buyer is not the seller
        require(_rider != msg.sender);
        // Mark as rideCompleted
        _ride.rideCompleted = true;
        // Update the product
        riders[_id] = _ride;
        // Pay the seller by sending them Ether
        address(_rider).transfer(msg.value);
        // Trigger an event
        emit rideCompleted(rideCount, _ride.route, _ride.fare, msg.sender, true);
    }
}
